import React from "react";
import { UseFetch } from "./useFetch";

export default function CustomHooks() {
  const url = "https://fakestoreapi.com/products"; // Définir l'URL ici
  const productData = UseFetch(url); // Appeler le hook personnalisé

  return (
    <>
      <h1>Custom Hooks</h1>
      {productData && productData.length > 0 ? (
        <ul>
          {productData.map((product) => (
            <li key={product.id}>
              <h2>{product.title}</h2>
              <p>{product.description}</p>
              <p>${product.price}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>Loading or API error...</p> // Afficher un message si les données ne sont pas encore chargées
      )}
    </>
  );
}
